import React from 'react';
import books from './books.jpg';
import '../Fonts/The Blacklist.ttf';
import './showcase.css';

const Showcase = () => {
	return (
		<header>
		<div className='showcase'>
				<h2 className='logo'>Better Bindings</h2>
				<a className='signin btn'>Sign In</a>
		</div>
		</header>
	)
}

export default Showcase;
